import React from "react";

const Register = ({ changeHandler }) => {
  return (
    <div className="registerMainDiv">
      <form className="registerForm">
        {[
          "name",
          "lastname",
          "username",
          "email",
          "password",
          // "repeatPassword",
        ].map((item, index) => {
          return (
            <input
              onChange={changeHandler}
              type={index < 4 ? "text" : "password"}
              name={item}
              placeholder={item !== 'repeatPassword' ? item : 'repeat password'}
              key={index}
              className="registerFormInput"
            ></input>
          );
        })}
        <button className="submitButton" style={{ width: "auto" }}>
          Submit
        </button>
      </form>
    </div>
  );
};

export default Register;
